d darauf abgestimmten Expertentipps! <a href=\"http://cheftest.xing.com?dpt=mcmhh&amp;ttp=sysn&amp;plf=own&amp;pid=sys&amp;xtr=chftstsys\">Zum Cheftest</a></p>\n</div><!--\n  Teaser: Start page news (green headline)\n-->\n<div class=\"dipa-teaser news-item\">\n  <span class=\"dipa-teaser-start-date\">18.06.2010</span>\n  <h4 class=\"dipa-teaser-title green\">WM-Einladungs-Special: Jetzt Kontakte einladen und Samsung Beamer gewinnen</h4> \n  <p class=\"dipa-teaser-body\">Machen Sie Ihr Wohnzimmer zum Heimkino! Laden Sie noch bis zum 11. Juli 2010 erfolgreich neue Mitglieder zu XING ein und gewinnen Sie mit etwas Glück einen Beamer von Samsung. Jede erfolgreiche Einladung steigert Ihre Gewinnchancen. <a href=\"https://www.xing.com/expand_network?dpt=mcmhh&amp;ttp=mail&amp;plf=own&amp;pid=wnl&amp;xtr=wmnvtspcl\">Jetzt Kontakte einladen</a></p>\n</div><!--\n  Teaser: Start page news (black headline)\n-->\n<div class=\"dipa-teaser news-item\">\n  <span class=\"dipa-teaser-start-date\">17.06.2010</span>\n  <h4 class=\"dipa-teaser-title\">Neu: Jobangebote merken und weiterempfehlen</h4> \n  <p class=\"dipa-teaser-body\">Setzen Sie ab sofort interessante Jobangebote auf Ihre persönliche Merkliste – so finden Sie sie jederzeit schnell wieder! Ihr Unternehmen oder ein Kontakt hat eine Stelle zu vergeben? Informieren Sie Ihr XING-Netzwerk oder empfehlen Sie den Jobs über Twitter weiter. <a href=\"https://www.xing.com/jobs/?dpt=mcmhh&amp;ttp=sysn&amp;plf=own&amp;pid=sys&amp;xtr=jbsnwfnctn\">Zu XING Jobs</a>\r<br /></p>\n</div><!--\n  Teaser: Start page news (green headline)\n-->\n<div class=\"dipa-teaser news-item\">\n  <span class=\"dipa-teaser-start-date\">09.06.2010</span>\n  <h4 class=\"dipa-teaser-title green\">WM-Fieber: Tippen sie gegen Ihre Kontakte und gewinnen Sie tolle Preise!</h4> \n  <p class=\"dipa-teaser-body\">Beweisen Sie beim großen XING WM-Tippspiel Ihr Gespür für das runde Leder und gewinnen Sie tolle Preise, z.B. eine Sonnenreise in die Türkei. Das Beste: Sie spielen automatisch gegen Ihre Kontakte. Bis zum Finale können Sie jederzeit einsteigen. Fügen Sie einfach die WM-Tippspiel-Applikation zu Ihrem XING-Profil hinzu und schon kann’s losgehen! <a href=\"http://win.xing.com/wmtippspiel?dpt=mcmhh&amp;ttp=sysn&amp;plf=own&amp;pid=sys&amp;xtr=wmtppspl\">Jetzt mittippen und gewinnen!</a>\r<br /></p>\n</div>\n</div>\n</div>\n<!--[if !IE]> 2nd col<![endif]-->\n<div class=\"col_one\">\n<!--[if !IE]> 2nd col 1st row <![endif]-->\n<div id=\"profile-box\" class=\"one-column-info-box\">\n<b class=\"adjacent-element\"></b>\n<div class=\"inner-profile-box\">\n<h4>Willkommen <a href=\"/app/profile?op=myprofile\" title=\"Profil bearbeiten\">Sven Erik Matzen</a><a class=\"icn icn-ext-premium-small\" href=\"/app/billing\" title=\"Premium-Mitglied\">&nbsp;&nbsp;&nbsp;Premium-Mitglied</a></h4>\n<a href=\"/profile/SvenErik_Matzen\" id=\"user-pic\">\n<img src=\"/img/users/5/e/5/c170c9090.3469680_s2.jpg\" alt=\"Mein Profil\" title=\"Mein Profil\" width=\"30\" height=\"40\" />\n</a>\n<a href=\"/app/message\" title=\"Neue Nachrichten\" class=\"block\">\n<img width=\"13\" height=\"14\" class=\"icn icn-ext-info-msg\" alt=\"\" src=\"/img/v/transparent_r1.gif\"/>0 neue Nachrichten\n</a>\n<a href=\"/app/contact?op=toconfirm\" title=\"Zu bestätigende Kontakte\" class=\"block\">\n<img width=\"13\" height=\"14\" class=\"icn icn-ext-ctr-con-no-hdr\" alt=\"\" src=\"/img/v/transparent_r1.gif\" />0 neue Kontaktanfragen\n</a>\n<p class=\"smalltxt2nd mb0 mt10\">\n\n\n\nPremium-Mitglied\n\n\n\n</p>\n</div>\n\n<div class=\"clr overflow pt5 mt5 border-top\">\n<div id=\"edit-widget-display-48864485\" style=\"display: block; background-color: #FFF;\" >\n<div class=\"edit-mode\">\n\n<p>\n<strong>Ihre Statusmeldung</strong>\n<a href=\"#\" id=\"status-message-info-display-48864485\" class=\"cursor-help\" >\n<img width=\"13\" height=\"13\" src=\"/img/v/transparent_r1.gif\" alt=\"Info\" class=\"icn icn-ext-ctr-info\">\n</a>\n</p>\n\n\n\n\n<input class=\"mb5 inline